// #2563. Count the Number of Fair Pairs
// https://leetcode.com/problems/count-the-number-of-fair-pairs/?envType=daily-question&envId=2025-04-19


"use strict"


/**
 * @param {number[]} nums
 * @param {number} lower
 * @param {number} upper
 * @return {number}
 */
function countFairPairs(nums, lower, upper) {
	let pairs = 0;

	let numbersMap = new Map();
	for(let n of nums){
		let count = 1;
		if(numbersMap.has(n)){
			count = numbersMap.get(n) + 1;
		}
		numbersMap.set(n, count);
	}
	let keys = [...numbersMap.keys()];

	if(keys.length === 1){
		for(let i = numbersMap.get(keys[0]) - 1; i > 0 ; i--){
			pairs += i;
		}
	}

	for(let i = 0; i < keys.length - 1; i++){
		for(let j = i + 1; j < keys.length; j++){
			if(keys[i] + keys[j] >= lower && keys[i] + keys[j] <= upper){
				pairs += numbersMap.get(keys[i]) * numbersMap.get(keys[j]);
			}
		}
	}
	return pairs;
};


